import{_ as e,o as t,c as i,d as a}from"./app.bea34d0c.js";const m=JSON.parse('{"title":"\u5BB6\u7528\u6444\u50CF\u5934\u672C\u5730\u5B58\u50A8\u548C\u67E5\u770B","description":"","frontmatter":{},"headers":[{"level":2,"title":"1. Shinobi\u914D\u7F6E","slug":"_1-shinobi\u914D\u7F6E","link":"#_1-shinobi\u914D\u7F6E","children":[{"level":3,"title":"1. \u5B89\u88C5Shinobi","slug":"_1-\u5B89\u88C5shinobi","link":"#_1-\u5B89\u88C5shinobi","children":[]},{"level":3,"title":"2. \u6DFB\u52A0\u6444\u50CF\u5934\u548C\u76D1\u89C6\u5668","slug":"_2-\u6DFB\u52A0\u6444\u50CF\u5934\u548C\u76D1\u89C6\u5668","link":"#_2-\u6DFB\u52A0\u6444\u50CF\u5934\u548C\u76D1\u89C6\u5668","children":[]}]},{"level":2,"title":"2. Alist\u8BBE\u7F6E","slug":"_2-alist\u8BBE\u7F6E","link":"#_2-alist\u8BBE\u7F6E","children":[]},{"level":2,"title":"3. Zerotier/Cloudflared\u8BBE\u7F6E","slug":"_3-zerotier-cloudflared\u8BBE\u7F6E","link":"#_3-zerotier-cloudflared\u8BBE\u7F6E","children":[]},{"level":2,"title":"4. \u6700\u540E","slug":"_4-\u6700\u540E","link":"#_4-\u6700\u540E","children":[]}],"relativePath":"project/others/\u5BB6\u7528\u6444\u50CF\u5934\u672C\u5730\u5B58\u50A8\u548C\u67E5\u770B.md","lastUpdated":1676973667000}'),s={name:"project/others/\u5BB6\u7528\u6444\u50CF\u5934\u672C\u5730\u5B58\u50A8\u548C\u67E5\u770B.md"},o=a(`<h1 id="\u5BB6\u7528\u6444\u50CF\u5934\u672C\u5730\u5B58\u50A8\u548C\u67E5\u770B" tabindex="-1">\u5BB6\u7528\u6444\u50CF\u5934\u672C\u5730\u5B58\u50A8\u548C\u67E5\u770B <a class="header-anchor" href="#\u5BB6\u7528\u6444\u50CF\u5934\u672C\u5730\u5B58\u50A8\u548C\u67E5\u770B" aria-hidden="true">#</a></h1><blockquote><p>\u786C\u4EF6: \u652F\u6301ONVIF\u7684\u5BB6\u7528\u6444\u50CF\u5934, Tplink\u597D\u50CF\u5168\u7CFB\u652F\u6301, \u6211\u7528\u7684\u578B\u53F7\u662F44gw</p><p>\u6280\u672F\u65B9\u6848: Shinobi + alist + zertier/cloudflared</p></blockquote><p>\u6700\u5F00\u59CB\u662F\u5728\u5F20\u5927\u5988\u4E0A\u770B\u5230\u6709\u4EBA\u7528<code>nas</code> \u5B9E\u73B0\u6444\u50CF\u5934\u7684\u672C\u5730\u5B58\u50A8\u548C\u67E5\u770B, \u56E0\u4E3A\u5A01\u8054\u901A\u548C\u7FA4\u6656\u90FD\u6709\u5BF9\u5E94\u7684\u5957\u4EF6\u652F\u6301, \u53EF\u4EE5\u6D41\u7A0B\u5F0F\u914D\u7F6E. \u4F46\u662FLinux\u7248\u672C\u6CA1\u6709\u5BF9\u5E94\u7684\u5957\u4EF6, \u6240\u4EE5\u5C31\u53EA\u80FD\u81EA\u5DF1\u641C\u7D22\u76F8\u5173\u65B9\u6848, \u5728\u63A5\u8FD1\u773C\u778E\u540E\u7EC8\u4E8E\u641E\u597D\u4E86.</p><p>\u7B2C\u4E00\u4E2A\u641C\u5230\u7684\u662F<strong>ZoneMinder</strong>, \u4F46\u662F\u90FD\u8BF4\u5B83\u6027\u80FD\u4E0D\u597D, \u7EE7\u800C\u8BDE\u751F\u4E86<strong>Shinobi</strong>, \u6240\u4EE5\u6211\u7684\u65B9\u6848\u5C31\u4E00\u6B65\u5230\u4F4D, \u76F4\u63A5\u4F7F\u7528<strong>Shinobi</strong>\u8FDB\u884C\u914D\u7F6E.</p><p>\u76EE\u524D\u5B9E\u73B0\u7684\u529F\u80FD\u6709</p><ul><li>\u6444\u50CF\u5934\u652F\u6301\u8FD0\u52A8\u68C0\u6D4B (<strong>Shinobi</strong>)</li><li>\u68C0\u6D4B\u5230\u8FD0\u52A8\u540E\u8FDB\u884C\u89C6\u9891\u4FDD\u5B58 (<strong>Shinobi</strong>)</li><li>\u5FAA\u73AF\u4FDD\u5B58\u89C6\u9891(3\u5929\u5185) (<strong>Shinobi</strong>)</li><li>\u53EF\u4EE5\u901A\u8FC7alist\u8FDB\u884C\u89C6\u9891\u7F51\u9875\u67E5\u770B (<strong>alist</strong>)</li><li>\u5982\u679C\u672C\u5730\u6CA1\u5916\u7F51ip, \u4E5F\u53EF\u4EE5\u8FDB\u884C\u5916\u7F51\u8BBF\u95EE\u67E5\u770B\u89C6\u9891 (<strong>cloudflared</strong>)</li></ul><h2 id="_1-shinobi\u914D\u7F6E" tabindex="-1">1. Shinobi\u914D\u7F6E <a class="header-anchor" href="#_1-shinobi\u914D\u7F6E" aria-hidden="true">#</a></h2><p>\u5B98\u7F51\u5730\u5740: <a href="https://docs.shinobi.video/" target="_blank" rel="noreferrer">https://docs.shinobi.video/</a></p><p>\u8BE5\u8BF4\u4E0D\u8BF4, Shinobi\u7684\u7F51\u9875\u770B\u7684\u773C\u775B\u662F\u771F\u7D2F, \u9ED1\u5E95\u767D\u5B57, \u8FD8\u90FD\u662F\u5C0F\u5C0F\u7684\u82F1\u6587, \u773C\u775B\u90FD\u8981\u778E\u4E86.</p><h3 id="_1-\u5B89\u88C5shinobi" tabindex="-1">1. \u5B89\u88C5Shinobi <a class="header-anchor" href="#_1-\u5B89\u88C5shinobi" aria-hidden="true">#</a></h3><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221121709114.png" alt="image-20230221121709114"></p><p>\u8FD9\u91CC\u5B98\u7F51\u63A8\u8350\u4F7F\u7528\u672C\u5730\u5B89\u88C5, \u8FD9\u6837\u4FBF\u4E8E\u5B89\u88C5\u8BB8\u591A\u63D2\u4EF6\u4EE5\u53CA\u548C\u4E3B\u673A\u4EA4\u4E92. \u4F46\u662F\u7531\u4E8E\u6211\u9700\u6C42\u6CA1\u90A3\u4E48\u591A, \u6240\u4EE5\u5C31\u4F7F\u7528docker\u5B89\u88C5\u4E86.</p><ul><li>\u5B89\u88C5\u547D\u4EE4</li></ul><div class="language-bash line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;"> bash </span><span style="color:#89DDFF;">&lt;(</span><span style="color:#C3E88D;">curl -s https://gitlab.com/Shinobi-Systems/Shinobi-Installer/raw/master/shinobi-docker.sh</span><span style="color:#89DDFF;">)</span></span>
<span class="line"></span></code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br></div></div><p>\u8FD0\u884C\u8BE5\u547D\u4EE4\u540E\u4F1A\u81EA\u52A8\u751F\u6210\u4E00\u4E2A<code>docker-compose</code> \u7684\u542F\u52A8\u6587\u4EF6, \u91CC\u9762\u6709\u6302\u8F7D\u5730\u5740\u548C\u542F\u52A8\u7AEF\u53E3\u7B49, \u5982\u4E0B</p><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221121957674.png" alt="image-20230221121957674"></p><ul><li>\u8BBF\u95EE\u9875\u9762</li></ul><p>\u5728\u6D4F\u89C8\u5668\u91CC\u9762\u8F93\u5165<code>ip+8080</code> \u5373\u53EF\u8BBF\u95EE\u914D\u7F6E\u9875\u9762. \u9996\u6B21\u767B\u5F55\u7684\u65F6\u5019(\u6B64\u65F6\u6211\u4EEC\u7F51\u5740\u540E\u9762\u8981\u52A0\u4E00\u4E2A<code>/super</code> \u540E\u7F00)\u9700\u8981\u4F7F\u7528\u8D85\u7EA7\u7BA1\u7406\u5458\u767B\u5F55, \u7136\u540E\u91CD\u5EFA\u4E00\u4E2A\u65B0\u7528\u6237. \u521B\u5EFA\u6210\u529F\u540E\u9000\u51FA\u8D85\u7EA7\u7BA1\u7406\u5458\u9875\u9762, \u7136\u540E\u4F7F\u7528\u65B0\u8D26\u6237\u767B\u5F55\u666E\u901A\u540E\u53F0\u914D\u7F6E\u9875(<code>ip+8080</code> ). \u5173\u4E8E\u672C\u6D41\u7A0B\u5B98\u7F51\u63CF\u8FF0\u5982\u4E0B</p><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221122231864.png" alt="image-20230221122231864"></p><h3 id="_2-\u6DFB\u52A0\u6444\u50CF\u5934\u548C\u76D1\u89C6\u5668" tabindex="-1">2. \u6DFB\u52A0\u6444\u50CF\u5934\u548C\u76D1\u89C6\u5668 <a class="header-anchor" href="#_2-\u6DFB\u52A0\u6444\u50CF\u5934\u548C\u76D1\u89C6\u5668" aria-hidden="true">#</a></h3><p>\u5982\u679C\u4F60\u7684\u6444\u50CF\u5934\u652F\u6301<code>ONVIF</code> \u534F\u8BAE, \u90A3\u4E48\u5C31\u5F88\u5BB9\u6613\u6DFB\u52A0.</p><ul><li>\u6DFB\u52A0\u6444\u50CF\u5934</li></ul><p>\u5728\u4E0A\u4E00\u6B65\u9AA4\u4F7F\u7528\u65B0\u5EFA\u8D26\u6237\u767B\u5F55\u9875\u9762\u540E, \u5728\u4FA7\u8FB9\u680F\u627E\u5230<code>ONVIF Scanner</code> \u9009\u9879, \u70B9\u51FB\u540E\u8FDB\u5165\u8BBE\u5907\u641C\u7D22\u6DFB\u52A0\u9875\u9762. \u5728\u9875\u9762\u7684<code>Scan Setting</code> \u533A\u57DF\u8BBE\u7F6E\u4F60\u6444\u50CF\u5934\u7684ip\u5730\u5740, \u7AEF\u53E3\u53F7, \u7528\u6237\u540D\u548C\u767B\u5F55\u5BC6\u7801, \u4EE5<code>Tplink</code> \u4E3A\u4F8B, ip\u5730\u5740\u548C\u7AEF\u53E3\u4FE1\u606F\u53EF\u4EE5\u5728APP\u7684<code>\u8BBE\u5907</code>\u9875, \u901A\u8FC7\u53F3\u4E0A\u89D2<code>\u66F4\u591A\u8BBE\u7F6E</code> -&gt; <code>\u6211\u7684\u6444\u50CF\u673A</code>\u627E\u5230, \u7528\u6237\u540D\u548C\u5BC6\u7801\u662FAPP\u4E0A\u8BBE\u7F6E\u7684\u8D26\u53F7\u5BC6\u7801. \u5F53\u8FD9\u4E9B\u4FE1\u606F\u8F93\u5165\u540E\u5373\u53EF\u70B9\u51FB\u4E0B\u9762\u7684<code>Search</code> \u6309\u94AE\u8FDB\u884C\u641C\u7D22.</p><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221122605506.png" alt="image-20230221122605506"></p><p>\u5982\u679C\u4E0A\u9762\u8BBE\u7F6E\u65E0\u95EE\u9898, \u540C\u65F6\u4F60\u7684\u8BBE\u5907\u4E5F\u6CA1\u95EE\u9898, \u53F3\u4FA7\u4FBF\u4F1A\u68C0\u6D4B\u5230\u6444\u50CF\u5934, \u5982\u4E0B\u6240\u793A</p><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221123248992.png" alt="image-20230221123248992"></p><p>\u5982\u679C\u6309\u7167\u4E0A\u9762\u64CD\u4F5C\u6CA1\u6709\u627E\u5230\u76F8\u5E94\u6444\u50CF\u5934, \u90A3\u4E48\u53EF\u4EE5\u7528\u5B98\u7F51<code>Adding a Camera Manually</code> \u7AE0\u8282\u7684\u5176\u4ED6\u65B9\u6CD5\u8FDB\u884C\u6DFB\u52A0. \u8FD9\u91CC\u6211\u6CA1\u5B9E\u9645\u64CD\u4F5C\u8FC7, \u5C31\u4E0D\u8FDB\u884C\u6269\u5C55\u4E86.</p><ul><li>\u6DFB\u52A0\u76D1\u89C6\u5668</li></ul><p>\u5728\u4E0A\u4E00\u6B65\u9AA4\u6210\u529F\u6DFB\u52A0\u6444\u50CF\u5934\u540E, \u5DE5\u5177\u81EA\u52A8\u7ED9\u6211\u4EEC\u6DFB\u52A0\u4E00\u4E2A\u76D1\u89C6\u5668<code>Monitor</code>, \u6211\u4EEC\u9700\u8981\u5BF9\u8FD9\u4E2A\u76D1\u89C6\u5668\u8FDB\u884C\u4E00\u4E9B\u57FA\u672C\u7684\u64CD\u4F5C.</p><ol><li>\u5728\u5DE6\u4FA7\u680F\u627E\u5230<code>Monitor Setting</code> \u9009\u9879, \u70B9\u51FB\u540E\u5728\u53F3\u4FA7\u9875\u9762\u9009\u62E9\u6211\u4EEC\u521A\u624D\u81EA\u52A8\u521B\u5EFA\u7684\u76D1\u89C6\u5668, \u7136\u540E\u8FDB\u884C\u914D\u7F6E(\u5982\u679C\u4E0D\u5728\u53F3\u4FA7\u9009\u62E9, \u9ED8\u8BA4\u662F\u65B0\u589E\u52A0\u76D1\u89C6\u5668). \u786E\u4FDD\u5176<code>Mode</code> \u4E3A<code>Watch-only</code> \u6A21\u5F0F, \u5728\u8BE5\u6A21\u5F0F\u4E0B\u624D\u80FD\u8FDB\u884C\u540E\u7EED\u8FD0\u52A8\u76D1\u6D4B\u5F55\u5236, \u5176\u4ED6\u5982<code>Record</code> \u6A21\u5F0F\u662F24\u5C0F\u65F6\u5F55\u5236.</li></ol><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221124138137.png" alt="image-20230221124138137"></p><ol start="2"><li>\u5728\u9875\u9762\u53F3\u4E0B\u89D2\u5C06\u5F53\u524D\u8BBE\u7F6E\u6539\u4E3A\u9AD8\u7EA7\u8BBE\u7F6E, \u5982\u4E0B\u6240\u793A.</li></ol><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221150851433.png" alt="image-20230221150851433"></p><ol start="3"><li>\u5728\u4FEE\u6539\u5B8C\u6BD5\u540E, \u6211\u4EEC\u9009\u62E9\u5DE6\u4FA7\u7684<code>Stream</code> \u9009\u9879, \u5C06\u53F3\u4FA7\u7684<code>Stream Type</code> \u6682\u65F6\u66F4\u6539\u4E3A<code>MJPEG</code> \u6A21\u5F0F, \u8FD9\u79CD\u6A21\u5F0F\u4FBF\u4E8E\u6211\u4EEC\u901A\u8FC7\u5B9E\u65F6h\u5916\u9762\u884C\u8FD0\u52A8\u68C0\u6D4B\u7684\u6D4B\u8BD5. (\u9ED8\u8BA4\u7684<code>HLS</code> \u4E0D\u80FD\u5728\u6211\u4EEC\u9875\u9762\u4E0A\u5B9E\u65F6\u663E\u793A\u6444\u50CF\u5934\u753B\u9762, \u4F46\u662F\u5176\u5229\u4E8E\u957F\u65F6\u95F4\u8FD0\u884C\u7684\u8FD0\u52A8\u76D1\u6D4B, \u6240\u4EE5\u540E\u7EED\u6211\u4EEC\u9700\u8981\u518D\u8C03\u6574\u8FC7\u6765.)</li></ol><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221124558113.png" alt="image-20230221124558113"></p><ol start="4"><li>\u7EE7\u7EED\u9009\u62E9<code>Detector Settings</code> \u9009\u9879, \u5C06\u53F3\u4FA7\u7684<code>Enabled</code> \u66F4\u6539\u4E3A<code>Yes</code>, \u5982\u4E0B\u6240\u793A.</li></ol><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221124849369.png" alt="image-20230221124849369"></p><p>\u8FD9\u91CC\u6211\u4EEC\u53EF\u4EE5\u518D\u53BB\u8BBE\u7F6E\u4E0B\u76D1\u6D4B\u533A\u57DF, \u8FD9\u91CC\u76F4\u63A5\u9F20\u6807\u62D6\u52A8\u53F3\u4FA7\u7EA2\u8272\u533A\u57DF\u7684\u70B9\u5373\u53EF</p><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221134625279.png" alt="image-20230221134625279"></p><ol start="5"><li>\u968F\u540E\u70B9\u51FB\u53F3\u4E0B\u89D2\u7684\u4FDD\u5B58\u6309\u94AE\u5373\u53EF, \u6B64\u65F6\u6211\u4EEC\u53EF\u4EE5\u5728<code>Live Grid</code> \u9009\u9879\u91CC\u9762\u770B\u5230\u6444\u50CF\u5934\u7684\u4E8B\u5B9E\u753B\u9762.</li><li>\u6D4B\u8BD5\u662F\u5426\u6210\u529F\u8BBE\u7F6E. \u6B64\u65F6\u9700\u8981\u4E00\u4E2A\u8FD0\u52A8\u7684\u7269\u4F53\u8FDB\u5165\u6444\u50CF\u5934\u533A\u57DF, \u7136\u540E\u518D\u6D88\u5931. \u5B8C\u6210\u4E0A\u9762\u6B65\u9AA4\u540E, \u8FDB\u5165\u53F3\u4FA7\u83DC\u5355\u7684<code>Videos</code> \u9875\u9762, \u5237\u65B0\u67E5\u770B\u662F\u5426\u6210\u529F\u8BB0\u5F55\u4E0B\u6765. \u5982\u679C\u548C\u4E0B\u56FE\u4E00\u6837\u6709\u89C6\u9891\u5B58\u5728, \u90A3\u5C31\u8868\u793A\u8BBE\u7F6E\u6210\u529F. \u6B64\u65F6\u6211\u4EEC\u9700\u8981\u518D\u8FD4\u56DE\u6B65\u9AA4\u4E09, <strong>\u5C06\u53F3\u4FA7\u7684<code>Stream Type</code> \u6682\u65F6\u66F4\u6539\u4E3A<code>HLS</code> \u6A21\u5F0F</strong>.</li></ol><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221125217801.png" alt="image-20230221125217801"></p><ol start="7"><li>\u4FDD\u5B58\u540E\u5373\u914D\u7F6E\u5B8C\u6210.</li></ol><h2 id="_2-alist\u8BBE\u7F6E" tabindex="-1">2. Alist\u8BBE\u7F6E <a class="header-anchor" href="#_2-alist\u8BBE\u7F6E" aria-hidden="true">#</a></h2><p>\u8FD9\u4E00\u6B65\u6765\u8BF4\u662F\u6BD4\u8F83\u7B80\u5355\u7684, \u53EA\u9700\u8981\u8FD0\u884C\u5BF9\u5E94\u5BB9\u5668\u5373\u53EF, \u9700\u8981\u6CE8\u610F\u7684\u662F\u8FD9\u91CC\u5BBF\u4E3B\u673A\u6302\u8F7D\u7684\u5730\u5740\u5728\u5BB9\u5668\u5185<code>/opt/alist/data</code> \u76EE\u5F55\u4E0B, \u5373\u5982\u679C\u6211\u4EEC\u628A\u5BBF\u4E3B\u673A\u7684<code>/root</code> \u6302\u5728\u5230\u5BB9\u5668\u4E0A, \u6211\u4EEC\u5728\u6302\u8F7D\u672C\u5730\u8D44\u6E90\u7684\u65F6\u5019\u6839\u8DEF\u5F84<code>/opt/alist/data</code> \u5C31\u76F8\u5F53\u4E8E\u5BBF\u4E3B\u673A\u7684<code>/root</code> \u76EE\u5F55.</p><p>\u542F\u52A8\u547D\u4EE4\u53EF\u53C2\u8003</p><div class="language-bash line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">docker run -d --restart=always -v /etc/alist:/opt/alist/data -p 5244:5244 -e PUID=0 -e PGID=0 -e UMASK=022 --name=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">alist</span><span style="color:#89DDFF;">&quot;</span><span style="color:#A6ACCD;"> xhofe/alist:latest</span></span>
<span class="line"></span></code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br></div></div><p>\u542F\u52A8\u6210\u529F\u540E, \u5373\u53EF\u5C06\u81EA\u5DF1\u672C\u5730\u7684\u76D1\u63A7\u5F55\u50CF\u5730\u5740\u6302\u8F7D\u4E0A\u53BB. \u5982\u4E0B\u6240\u793A</p><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221134859433.png" alt="image-20230221134859433"></p><h2 id="_3-zerotier-cloudflared\u8BBE\u7F6E" tabindex="-1">3. Zerotier/Cloudflared\u8BBE\u7F6E <a class="header-anchor" href="#_3-zerotier-cloudflared\u8BBE\u7F6E" aria-hidden="true">#</a></h2><p>\u8FD9\u91CC\u53EF\u4EE5\u53C2\u8003\u6211\u4E4B\u524D\u7684<a href="https://scattter.github.io/devops/others/%E7%89%A9%E7%90%86%E6%9C%BA%E5%AE%89%E8%A3%85Linux%E5%90%8C%E6%97%B6%E5%AE%9E%E7%8E%B0%E5%86%85%E7%BD%91%E7%A9%BF%E9%80%8F.html" target="_blank" rel="noreferrer">\u6587\u7AE0(\u70B9\u51FB\u5373\u53EF\u8FDB\u5165)</a></p><p>Zerotier\u7528\u4E8E\u5185\u7F51\u8BBF\u95EE, Cloudflared\u7528\u6237\u5916\u7F51\u8BBF\u95EE. \u8BBE\u7F6E\u597D\u540E\u5373\u53EF\u8BBF\u95EE.</p><p><img src="https://cdn.jsdelivr.net/gh/scattter/blogweb/images/image-20230221150214596.png" alt="image-20230221150214596"></p><h2 id="_4-\u6700\u540E" tabindex="-1">4. \u6700\u540E <a class="header-anchor" href="#_4-\u6700\u540E" aria-hidden="true">#</a></h2><p>Shinobi\u652F\u6301\u7684\u529F\u80FD\u8FD8\u6709\u5F88\u591A, \u5305\u62EC\u7269\u4F53\u68C0\u6D4B, \u6D88\u606F\u901A\u77E5\u7B49, \u4EE5\u53CA\u8FD8\u6709\u8BB8\u591A\u63D2\u4EF6, \u4F46\u662F\u76EE\u524D\u6211\u8FD8\u7528\u4E0D\u5230\u8FD9\u4E9B, \u800C\u4E14\u5B83\u7684\u7F51\u9875\u770B\u7740\u4E5F\u5C31\u8D39\u773C, \u8FD9\u4E9B\u5C31\u540E\u9762\u6709\u5174\u8DA3\u4E86\u518D\u53BB\u63A2\u7D22\u4E0B.</p>`,54),l=[o];function n(r,d,c,p,g,h){return t(),i("div",null,l)}const _=e(s,[["render",n]]);export{m as __pageData,_ as default};
